import logo from './logo.svg';
import './App.css';

function App() {
  return (
  <div className="AppPage">
    <div className="AppTopPage">
      1
    </div>
    <div className="AppMiddlePage">
      1
    </div>
    <div className="AppBottomPage">
    <iframe
    allow="microphone;"
    width="350"
    height="1000"
    src="https://console.dialogflow.com/api-client/demo/embedded/t-mobile">
</iframe>
    </div>
  </div>
  );
}

export default App;
